import * as React from 'react';
import { Input } from 'antd';
import MainLayout from '../../layout/MainLayout';
import './index.less';

const Login = (): React.ReactElement => (
  <MainLayout sidebarCollapsed>
    <div id="login-page">
      <Input />
    </div>>
  </MainLayout>
);

export default Login;
